export const initialState = {
    mainPosts: [{
        id: 1,
        user:{
            id:1,
            nickname:'meno',
        },
        content: '게시글 #해시태그 #익스프레스',
        Images:[
            {
                src:''
            },
            {
                src:''
            },
            {
                src:''
            },
        ]
    }],
};

const reducer = (state = initialState, action)=>{
    switch (action.type){
        default:
            return state;

    }
};

export default reducer;
